import React from 'react';
import './App.scss';
import image from "./image.svg";
import Navbar from "./Components/Navbar";
import Welcome from "./Components/Welcome";

const heading= "";
const paragraph ="";
const button_text ="";
const svg = image;

function App() {

  return (
    <div className="App">
      <Navbar />
      <Welcome 
        heading={heading}
        paragraph={paragraph}
        button_text={button_text}
        svg={svg}
      />      
    </div>
  );
}

export default App;
